import React from "react";
import Contributors from "./Contributors";

function TableList() {
  const contributors = ["Gemm", "Esther"];

  return (
    <ul>
      {contributors.map((user) => (
        <Contributors user={user} />
      ))}
    </ul>
  );
}

export default TableList;
